<p>\u041F\u0435\u0440\u0435\u0441\u0442\u0430\u043D\u044C\u0442\u0435 \u0432\u0438\u043D\u0438\u0442\u044C \u0441\u0435\u0431\u044F! \u0417\u0430\u0431\u043B\u0443\u0436\u0434\u0435\u043D\u0438\u044F \u0438 \u0444\u0435\u0439\u043A\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0437\u0430\u0441\u0442\u0430\u0432\u043B\u044F\u044E\u0442 \u0432\u0430\u0441 \u0441\u0447\u0438\u0442\u0430\u0442\u044C \u0441\u0435\u0431\u044F \u043F\u043B\u043E\u0445\u043E\u0439 \u043C\u0430\u0442\u0435\u0440\u044C\u044E</p>
